(3, 42, 'Terms & Conditions', 'terms-conditions', '', '<div id="termsandconditions" style="margin: 10px;">\r\n<h4>Acceptance form for individuals</h4>\r\n<p>This Acceptance form is part of the LanteOTC Trading Platform</p>\r\n<p>Terms and Conditions. If you want to trade on the LanteOTC trading platform, you must sign this document and send it back to us or click ‘I have read and accept the Trading Platform Terms and Conditions’ on the website.</p>\r\n<p>Please read this Acceptance form carefully as it sets out what you agree to and the promises you make before you can start using the trading platform.</p>\r\n<p>Words defined in the Trading Platform Terms and Conditions have the same meaning in this Acceptance form. The same rules of interpretation apply.</p>\r\n<p>When you sign this Acceptance form, you do not automatically have the right to use the trading platform. You will only be able to start buying and selling shares on the trading platform once you have been verified.</p>\r\n<h4>When you sign this Acceptance form and return it to us:</h4>\r\n<ol>\r\n<li>You agree that you have read and understand all the provisions of the Trading Platform Terms and Conditions; and</li>\r\n<li>You accept the Trading Platform Terms and Conditions; and</li>\r\n<li>You make promises to us; and</li>\r\n<li>The companies listed are owned by University students and graduates.</li>\r\n<li>You are signing one agreement with both LanteOTP. If you use the website to accept the Trading Platform Terms and Conditions, when you click ‘I have read and accept the Trading Platform Terms and Conditions, we may treat it as if you have signed this Acceptance form in pen. The fees are indicated on this tool before trades are done.<br /> There are various sections in the Trading Platform Terms and Conditions where:<br />\r\n<ul>\r\n<li>our legal responsibilities are excluded or limited, including the amounts you can claim from us; and</li>\r\n<li>rights you have against us are limited or excluded; and</li>\r\n<li>you take on the responsibility for certain losses or damages that might happen; and</li>\r\n<li>We identify some of the things that can go wrong or that might be dangerous when using the trading platform.</li>\r\n</ul>\r\nSection Passwords, shareholder numbers and security answers, adequate internal steps will be taken to verify the user if log in details have perhaps been forgotten.</li>\r\n<li>Authorised representatives, if you are represented by a broker, your broker is your authorised representative and you will not have access to the trading platform.</li>\r\n<li>Buying and selling shares on the trading platform:- We can never be sure that you can buy or sell shares for a good price or expected price.</li>\r\n<li>When there is a match, a sale of shares contract is created, seller agrees to sell and the buyer agree to buy.</li>\r\n<li>Transferring amounts to your chosen bank account, check that your chosen active bank account is open and the details are correct.</li>\r\n<li>Use of personal information and telephone recordings, this includes registering share transfer of share, processing trades, matching trades, arranging payments and sending notices to you.</li>\r\n<li>Viruses and other harmful features or content, we will take steps to keep the trading platform free of viruses and other harmful features and content. However we do not promise that we will always be able to achieve this.</li>\r\n<li>Promises you make to us In this section, you are making promises to us. This means you may not later deny what you have promised. We are allowed to treat it as if the promises you have made are true. If you have not told the truth, we are allowed to take action against you, including forcing you to sell the shares to us at a very low value. You promise that:<ol>\r\n<li>You understand that you are totally liable for all transactions made at any given point in time on buying and selling of shares.</li>\r\n<li>You are not a company.</li>\r\n<li>As an individual you promise that you have full legal capacity to enter into this agreement with us.</li>\r\n</ol>\r\n<p><strong>If you are an authorised representative, you promise:</strong></p>\r\n<ul>\r\n<li>that you have Full legal capacity to enter into this agreement on behalf of the individual who owns or wishes to buy shares on the trading platform.</li>\r\n<li>the statements contained in this Acceptance form are true for the individual that you represent.</li>\r\n<li>You are not allowed to give others rights to the shares, you are not allowed to use the shares in place of money to pay for things.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p>I have read and accept the Trading Platform Terms and Conditions</p>\r\n</div>', '', 1, 0, 0, 9, '2013-08-20 08:54:22', 928, '', '2013-08-20 08:54:49', 928, 0, '0000-00-00 00:00:00', '2013-08-20 08:54:22', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 0, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
