(7, 47, 'CFO resigns', 'telkom-cfo-resigns', '', '<p>Accountable for developing and implementing internal audit strategies for Telkom Group and subsidiaries and to ensure proper management of the internal audit function. Ensure that significant risks are understood and managed by management and ensure that significant risks are independently and objectively reviewed periodically.</p>\r\n<p>Responsible to lead the Property Asset Management division and to drive the optimisation of Telkom property/ real estate and lease management Portfoli.</p>\r\n<p> </p>', '', 1, 0, 0, 8, '2013-10-26 16:02:31', 929, 'Lante Luthuli', '2013-10-26 16:09:29', 929, 0, '0000-00-00 00:00:00', '2013-10-26 16:01:55', '2013-10-28 16:02:05', '{"image_intro":"","image_intro_alt":"","image_intro_caption":"","float_intro":"","image_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":"","float_fulltext":""}', '{"urla":"","urlatext":"","targeta":"","urlb":"","urlbtext":"","targetb":"","urlc":"","urlctext":"","targetc":""}', '', 2, 0, 2, '', '', 1, 4, '', 1, '*', ''),
(8, 48, 'Small businesses find gold', 'small-businesses-find-gold', '', '<div class="article_text article_paragraph0">\r\n<p>A year ago, Tammy Larson decided she needed to infuse some life into her flagging massage therapy practice, so she turned to the Internet.</p>\r\n</div>\r\n<p>It was mid-2011 and, while Larson had managed to stay above water during the recession, things were slow. A friend and fellow business owner suggested she try Groupon, a national site that allows business owners to market low-priced deals on goods and services to a wide audience.</p>', '', 1, 0, 0, 8, '2013-10-26 16:14:34', 929, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2013-10-26 16:14:34', '0000-00-00 00:00:00', '{"image_intro":"","image_intro_alt":"","image_intro_caption":"","float_intro":"","image_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":"","float_fulltext":""}', '{"urla":"","urlatext":"","targeta":"","urlb":"","urlbtext":"","targetb":"","urlc":"","urlctext":"","targetc":""}', '', 1, 0, 1, '', '', 1, 8, '', 0, '*', ''),
